Take a look at main.c and fact.c provided. 402b1ca (Modify examples for RISC-V) int main() { unsigned f = fact(5); printf("%u\n", f); return 0;
} unsigned fact(unsigned x) { if (x < 2) return 1; return x * fact(x - 1);
} First, let's from here use only RISC-V toolchain: source /opt/sc-dt/env.sh # NOTE: if you are using something other than bash, this might not work. If so, try the old fashioned path export
export CC=/opt/sc-dt/riscv-gcc/bin/
export PATH=${PATH}:/opt/sc-dt/riscv-gcc/bin
export PATH=${PATH}:/opt/sc-dt/tools/bin # For QEMU main here does not know that fact function exists. If we try to compile main to the executable make exec, we will get following error: /opt/sc-dt/riscv-gcc/bin/../lib/gcc/riscv64-unknown-linux-gnu/12.2.1/../../../../riscv64-unknown-linux-gnu/bin/ld: /tmp/ccqIh9oC.o: in function `main':
main.c:(.text+0xa): undefined reference to `fact'
